import axios, { AxiosResponse } from 'axios';
import React from 'react';
import { animal } from '../interfaces/interfaces';

export default function AnimalCall() {
  axios.get<any, animal[]>('https://localhost:7298/Animal/GetAnimals')
  .then((response: animal[]) => {

    const animals: animal[] = response.map((responseItem) => {
      return {
        animalId: responseItem.animalId,
        name: responseItem.name
      }
    })
  })
  .catch(error => {
    console.log(error);
  });
}


